class Solution {

    /**
     * @param String $s
     * @param String $a
     * @param String $b
     * @param Integer $k
     * @return Integer[]
     */
    function beautifulIndices($s, $a, $b, $k) {
        $beautifulIndices = [];
        $aLen = strlen($a);
        $bLen = strlen($b);
        $sLen = strlen($s);

        // Find all start indices of a and b in s
        $aStarts = [];
        $bStarts = [];
        for ($i = 0; $i <= $sLen - $aLen; $i++) {
            if (substr($s, $i, $aLen) == $a) {
                $aStarts[] = $i;
            }
        }
        for ($i = 0; $i <= $sLen - $bLen; $i++) {
            if (substr($s, $i, $bLen) == $b) {
                $bStarts[] = $i;
            }
        }

        foreach ($aStarts as $aStart) {
            foreach ($bStarts as $bStart) {
                if (abs($aStart - $bStart) <= $k) {
                    $beautifulIndices[] = $aStart;
                    break; // Once a matching b is found for this a, no need to continue checking
                }
            }
        }

        return $beautifulIndices;
    }
}
